import './App.css';
import ContactComponent from './components/pure/contact';
import { Contact } from './models/contact.class';


function App() {
  const defaultContact = new Contact('Benjamín', 'Martínez', 'b.martinezs@gmail.com', 'false');
  return (
    <div className="App">
      <header className="App-header">
        <ContactComponent
          props={defaultContact}
        ></ContactComponent>
      </header>
    </div>
  );
}

export default App;
